pragma solidity ^0.4.23;
pragma experimental ABIEncoderV2;

import "./StakableRegistry.sol"; 
import "../interfaces/IVoteController.sol";
import "../interfaces/IVoteOrigin.sol";
import "../interfaces/IParameterSource.sol";

contract ChallengeableRegistry is StakableRegistry, IVoteOrigin { 
    uint constant private SECONDS_IN_HOUR = (60 * 60);

    struct VoteReference { 
        address voteContract;
        uint voteId;
        bool pendingCreation; 
    }

    IVoteController.VoteConfiguration public voteConfiguration;
    string public voteStyle;
    IParameterSource internal parameters;

    mapping(string => VoteReference) internal challenges;

    // TODO: Do we want this? 
    // mapping(string => Vote[]) private vote_history; 

    event VoteStarted(string key, address voteContract, uint voteId);
    event VoteCompleted(string key, address voteContract, uint voteId);
    event Debug(string step);

    constructor(
        address _parametersAddress,
        uint256 _minStake,
        string _style,
        uint _challengePenalty,
        uint _votePenalty,
        uint _challengeLength,
        uint _challengeDistribution,
        uint256 _minVoteStake,
        uint256 _minVoteIncrementalStake
        ) public 
        StakableRegistry(_parametersAddress, _minStake) { 
        require(bytes(_style).length > 0, "Vote style is set to non-zero length string");
        require(_challengePenalty <= 100, "Challenge penalty must be less than or equal to 100%");
        require(_votePenalty <= 100, "Voting penalty must be less than or equal to 100%");
        require(_challengeLength >= (SECONDS_IN_HOUR * 1), "Challenge length must be atleast 1 hour.");
        require(_minVoteStake > 0, "Minumum voting stake must be non zero.");
        require(_minVoteIncrementalStake > 0, "Minumum voting incremental stake must be non zero.");
        require(_challengeDistribution <= 100, "Challenge distribution must be less than 100%");

        voteStyle = _style;

        voteConfiguration.style = _style;
        voteConfiguration.challengePenalty = _challengePenalty;
        voteConfiguration.votePenalty = _votePenalty;
        voteConfiguration.challengeLength = _challengeLength; 
        voteConfiguration.challengeDistribution = _challengeDistribution;
        voteConfiguration.minVoteStake = _minVoteStake;
        voteConfiguration.minVoteIncrementalStake = _minVoteIncrementalStake;

        parameters = IParameterSource(_parametersAddress);
    }

    function getActiveVote(string _key) public view returns (address _voteContract, uint _voteId) { 
        return (challenges[_key].voteContract, challenges[_key].voteId);
    }

    function deleteItem(string _key) public returns (bool _success) { 
        // Can't delete an item whilst a vote is active
        require(!isItemChallenged(_key), "Item cannot be deleted whilst challenged.");
        return super.deleteItem(_key);
    }

    function challengeItem(string _key, string _newValue, uint256 _challengeStake) public returns (bool _success, uint _voteId) { 
        require(hasItem(_key), "Item must exist");

        // Can't challenge an item with an active vote
        require(!isItemChallenged(_key), "Item must not currently be challenged to create a new challenge.");

        // Can't chanllenge an item unless the stake is <= the challenge stake
        require(getItemStake(_key) < _challengeStake, "Challenge stake must be greater than current item stake.");

        // Ensure the challenger has enough tokens 
        require(_depositHere(_challengeStake), "Challenge stake deposit must be successful");

        address voteAddress = parameters.getAddress("VOTE", voteStyle);

        require(voteAddress != address(0), "Vote controller address must be set");

        IVoteController.VoteDescriptor memory descriptor = _createDescriptor(_key, msg.sender, _newValue, _challengeStake);

        _moveFundsToVoteContract(descriptor, voteAddress);

        challenges[_key].pendingCreation = true; 
        challenges[_key].voteContract = voteAddress;

        IVoteController voteController = IVoteController(voteAddress);

        bool success = false;
        uint voteId = 0;
        (success, voteId) = voteController.beginVote(descriptor);

        require(success, "Vote must be be succesfully created");
        require(voteId > 0, "Vote Id must be non-zero");

        challenges[_key].pendingCreation = false;
        challenges[_key].voteId = voteId;

        emit VoteStarted(_key, voteAddress, voteId);
        return (true, voteId); 
    }

    function _moveFundsToVoteContract(IVoteController.VoteDescriptor memory _descriptor, address voteAddress) private  {
        // Transfer both the candidates stakes to the voting contract
        uint256 totalInitialStake = _descriptor.incumbent.stake.add(_descriptor.challenger.stake);

        _transferDeposit(_descriptor.incumbent.owner, voteAddress, _descriptor.incumbent.stake);
        _transferDeposit(_descriptor.challenger.owner, voteAddress, _descriptor.challenger.stake);
        _withdrawTo(voteAddress, totalInitialStake);
    }

    function _createDescriptor(string _key, address _challenger, string _newValue, uint256 _challengeStake) private view returns (IVoteController.VoteDescriptor memory _descriptor) { 
        address incumbentOwner;
        string memory incumbentValue; 
        uint[] memory _bh;
        uint _ts;
        uint256 incumbentStake;
        (incumbentOwner, incumbentValue, _bh, _ts, incumbentStake) = getItemWithStake(_key);

        require(incumbentOwner != _challenger, "Owner of item may not challenge themselves");

        IVoteController.VoteDescriptor memory descriptor; 
        descriptor.key = _key;

        // Incumbent
        descriptor.incumbent.owner = incumbentOwner;
        descriptor.incumbent.value = incumbentValue;
        descriptor.incumbent.stake = incumbentStake;

        // Chanllenger
        descriptor.challenger.owner = _challenger;
        descriptor.challenger.value = _newValue;
        descriptor.challenger.stake = _challengeStake;

        descriptor.configuration = voteConfiguration;

        return descriptor;
    }

    function isVotePending(string _key) public view returns (bool _isPending) { 
        return challenges[_key].pendingCreation && msg.sender == challenges[_key].voteContract;
    }

    function assignVoteOutcome(uint _voteId, string _key, address _winner, string _value, uint256 _stake) public returns (bool _success) { 
        if(challenges[_key].voteId != _voteId || challenges[_key].voteContract != msg.sender) { 
            return false; 
        }

        if(!_attributeUnowned(_winner, _stake)) { 
            return false; 
        }

        //_transferItem(_key, _winner, _value, _stake);

        delete challenges[_key];

        emit VoteCompleted(_key, challenges[_key].voteContract, challenges[_key].voteId);

        return true;
    }

    function isItemChallenged(string _key) private view returns (bool _isChallenged) { 
        return challenges[_key].voteId != 0;
    }
}
